deployment.program:
program axis_lending_v2.aleo;

record LoanTicket:
    owner as address.private;
    loan_id as field.private;
    principal as u64.private;
    collateral as u64.private;
    interest_rate_bps as u64.private;
    tier as u8.private;
    start_time as u64.private;
    due_time as u64.private;

record LiquidityReceipt:
    owner as address.private;
    receipt_id as field.private;
    amount as u64.private;
    pool_share_bps as u64.private;
    deposited_at as u64.private;
    lock_until as u64.private;

mapping total_liquidity:
    key as u8.public;
    value as u64.public;

mapping total_borrowed:
    key as u8.public;
    value as u64.public;

mapping total_collateral:
    key as u8.public;
    value as u64.public;

mapping insurance_fund:
    key as u8.public;
    value as u64.public;

mapping active_loans:
    key as field.public;
    value as boolean.public;

mapping tier_borrowed:
    key as u8.public;
    value as u64.public;

mapping loans_originated:
    key as u8.public;
    value as u64.public;

mapping loans_repaid:
    key as u8.public;
    value as u64.public;

function seed_the_axis:
    input r0 as address.private;
    input r1 as u64.private;
    input r2 as u64.private;
    input r3 as u64.private;
    gte r1 1000000u64 into r4;
    assert.eq r4 true;
    gte r2 7u64 into r5;
    assert.eq r5 true;
    div r1 20u64 into r6;
    sub r1 r6 into r7;
    div r7 100u64 into r8;
    mul r2 86400u64 into r9;
    add r3 r9 into r10;
    hash.bhp256 r3 into r11 as field;
    cast r0 r11 r7 r8 r3 r10 into r12 as LiquidityReceipt.record;
    async seed_the_axis r7 r6 into r13;
    output r12 as LiquidityReceipt.record;
    output r13 as axis_lending_v2.aleo/seed_the_axis.future;

finalize seed_the_axis:
    input r0 as u64.public;
    input r1 as u64.public;
    get.or_use total_liquidity[0u8] 0u64 into r2;
    add r2 r0 into r3;
    set r3 into total_liquidity[0u8];
    get.or_use insurance_fund[0u8] 0u64 into r4;
    add r4 r1 into r5;
    set r5 into insurance_fund[0u8];

function access_liquidity:
    input r0 as address.private;
    input r1 as u64.private;
    input r2 as u64.private;
    input r3 as u8.private;
    input r4 as u64.private;
    gte r1 100000u64 into r5;
    assert.eq r5 true;
    div r1 2u64 into r6;
    mul r1 3u64 into r7;
    div r7 4u64 into r8;
    mul r1 9u64 into r9;
    div r9 10u64 into r10;
    is.eq r3 1u8 into r11;
    gte r2 r6 into r12;
    and r11 r12 into r13;
    is.eq r3 2u8 into r14;
    gte r2 r8 into r15;
    and r14 r15 into r16;
    is.eq r3 3u8 into r17;
    gte r2 r10 into r18;
    and r17 r18 into r19;
    or r13 r16 into r20;
    or r20 r19 into r21;
    assert.eq r21 true;
    ternary r14 500u64 800u64 into r22;
    ternary r11 350u64 r22 into r23;
    hash.bhp256 r4 into r24 as field;
    add r4 2592000u64 into r25;
    cast r0 r24 r1 r2 r23 r3 r4 r25 into r26 as LoanTicket.record;
    async access_liquidity r24 r1 r2 r3 into r27;
    output r26 as LoanTicket.record;
    output r27 as axis_lending_v2.aleo/access_liquidity.future;

finalize access_liquidity:
    input r0 as field.public;
    input r1 as u64.public;
    input r2 as u64.public;
    input r3 as u8.public;
    get.or_use total_borrowed[0u8] 0u64 into r4;
    add r4 r1 into r5;
    set r5 into total_borrowed[0u8];
    get.or_use total_collateral[0u8] 0u64 into r6;
    add r6 r2 into r7;
    set r7 into total_collateral[0u8];
    get.or_use tier_borrowed[r3] 0u64 into r8;
    add r8 r1 into r9;
    set r9 into tier_borrowed[r3];
    set true into active_loans[r0];
    get.or_use loans_originated[0u8] 0u64 into r10;
    add r10 1u64 into r11;
    set r11 into loans_originated[0u8];

function repay_loan:
    input r0 as LoanTicket.record;
    input r1 as u64.private;
    gte r1 r0.principal into r2;
    assert.eq r2 true;
    async repay_loan r0.loan_id r0.principal r0.collateral r0.tier into r3;
    output r3 as axis_lending_v2.aleo/repay_loan.future;

finalize repay_loan:
    input r0 as field.public;
    input r1 as u64.public;
    input r2 as u64.public;
    input r3 as u8.public;
    get.or_use total_borrowed[0u8] 0u64 into r4;
    gte r4 r1 into r5;
    sub r4 r1 into r6;
    ternary r5 r6 0u64 into r7;
    set r7 into total_borrowed[0u8];
    get.or_use total_collateral[0u8] 0u64 into r8;
    gte r8 r2 into r9;
    sub r8 r2 into r10;
    ternary r9 r10 0u64 into r11;
    set r11 into total_collateral[0u8];
    get.or_use tier_borrowed[r3] 0u64 into r12;
    gte r12 r1 into r13;
    sub r12 r1 into r14;
    ternary r13 r14 0u64 into r15;
    set r15 into tier_borrowed[r3];
    set false into active_loans[r0];
    get.or_use loans_repaid[0u8] 0u64 into r16;
    add r16 1u64 into r17;
    set r17 into loans_repaid[0u8];

function flag_default:
    input r0 as LoanTicket.record;
    async flag_default r0.loan_id r0.principal r0.collateral r0.tier into r1;
    output r1 as axis_lending_v2.aleo/flag_default.future;

finalize flag_default:
    input r0 as field.public;
    input r1 as u64.public;
    input r2 as u64.public;
    input r3 as u8.public;
    get.or_use total_borrowed[0u8] 0u64 into r4;
    gte r4 r1 into r5;
    sub r4 r1 into r6;
    ternary r5 r6 0u64 into r7;
    set r7 into total_borrowed[0u8];
    get.or_use total_collateral[0u8] 0u64 into r8;
    gte r8 r2 into r9;
    sub r8 r2 into r10;
    ternary r9 r10 0u64 into r11;
    set r11 into total_collateral[0u8];
    get.or_use insurance_fund[0u8] 0u64 into r12;
    add r12 r2 into r13;
    set r13 into insurance_fund[0u8];
    get.or_use tier_borrowed[r3] 0u64 into r14;
    gte r14 r1 into r15;
    sub r14 r1 into r16;
    ternary r15 r16 0u64 into r17;
    set r17 into tier_borrowed[r3];
    set false into active_loans[r0];

function withdraw_liquidity:
    input r0 as LiquidityReceipt.record;
    input r1 as u64.private;
    gte r1 r0.lock_until into r2;
    assert.eq r2 true;
    async withdraw_liquidity r0.amount into r3;
    output r3 as axis_lending_v2.aleo/withdraw_liquidity.future;

finalize withdraw_liquidity:
    input r0 as u64.public;
    get.or_use total_liquidity[0u8] 0u64 into r1;
    gte r1 r0 into r2;
    sub r1 r0 into r3;
    ternary r2 r3 0u64 into r4;
    set r4 into total_liquidity[0u8];

constructor:
    assert.eq edition 0u16;
